import Note from "./Note";

const NotesList = ({ notes }) => {
  console.log(notes);
  return (
    <div className="grid-container">
      {notes.map((note) => {
        return <Note text={notes.text} date={notes.time} />;
      })}
    </div>
  );
};

export default NotesList;
